import React from "react";
import "./Login.css";

function Login() {
  return (
    <div className="login">
      <div className="login_container">
        <img src="http://cdm/mos.cms.futurecdn.net/SDDw7" alt="" />
        <h1>Sign in to Developer Gang HQ</h1>
        <p>developergang.slack.com</p>
      </div>
    </div>
  );
}

export default Login;
